
CREATE DATABASE hr_data;

CREATE TABLE hrdata(
   emp_no           INTEGER  NOT NULL PRIMARY KEY 
  ,gender           VARCHAR(6) NOT NULL
  ,marital_status   VARCHAR(8) NOT NULL
  ,age_band         VARCHAR(8) NOT NULL
  ,age              INTEGER  NOT NULL
  ,department       VARCHAR(5) NOT NULL
  ,education        VARCHAR(17) NOT NULL
  ,education_field  VARCHAR(16) NOT NULL
  ,job_role         VARCHAR(25) NOT NULL
  ,business_travel  VARCHAR(17) NOT NULL
  ,employee_count   BIT  NOT NULL
  ,attrition        VARCHAR(3) NOT NULL
  ,attrition_label  VARCHAR(17) NOT NULL
  ,job_satisfaction INTEGER  NOT NULL
  ,active_employee  BIT  NOT NULL
);

